    [],nt"num_tags": 4,nt"name": "narrative-report-missisquoi-national-wildlife-refuge-september-december-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Missisquoi NWR
    outlines Refuge accomplishments from September through December of 1963. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and vegetation control. Resource management
    is outlined; topics include grazing. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, violations, and
    safety. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
